"top\" data-original-title=\"Simple Tooltip\">Geek Unit</a>. L\'agence est capable de satisfaire votre besoin dans le monde du développement informatique. Précisement, l\'agence cherche la solution pour rendre possible votre imagination conçernant la numérisation et la culture de la nouvelle téchnologie.</p><p><a class=\"itl-tooltip\" title=\"\" href=\"http://localhost/projets/geek_unit/srcs/wp-content/themes/geek_unit/about.php#\" data-placement=\"top\" data-original-title=\"Simple Tooltip\">Geek Unit</a> ne récule guerre quand il s\'agit encore du développement pour la numérisation. La société est capable de prendre des projets, de s\'engager totalement à ce projet , de prendre même de risque , du temps pour satisfaire ses clients. Quelque soit l\'ampleur des projets, pas de recule, pas d\'abondant, car nous savons tous que la route est encore longue alors on ne s\'arrêtent pas à mis chemin....</p>'),(911,37,'_about_content_description','field_5b93b79744036'),(912,42,'about_content_title','Bienvenue sur notre Agence'),(913,42,'_about_content_title','field_5b93b58922df1'),(914,42,'about_content_description','<p>Notre agence est une société d\'ingénieurie informatique , elle est nommée <a class=\"itl-tooltip\" title=\"\" href=\"http://localhost/projets/geek_unit/srcs/wp-content/themes/geek_unit/about.php#\" data-placement=\"top\" data-original-title=\"Simple Tooltip\">Geek Unit</a>. L\'agence est capable de satisfaire votre besoin dans le monde du développement informatique. Précisement, l\'agence cherche la solution pour rendre possible votre imagination conçernant la numérisation et la culture de la nouvelle téchnologie.</p><p><a class=\"itl-tooltip\" title=\"\" href=\"http://localhost/projets/geek_unit/srcs/wp-content/themes/geek_unit/about.php#\" data-placement=\"top\" data-original-title=\"Simple Tooltip\">Geek Unit</a> ne récule guerre quand il s\'agit encore du développement pour la numérisation. La société est capable de prendre des projets, de s\'engager to